import { Container, Typography, FormControl, InputLabel } from '@mui/material'
import React from 'react'

const AddUser = () => {
  return (
    <Container>
        <Typography variant='h4'>Add User</Typography>
        <FormControl>
            <InputLabel></InputLabel>
        </FormControl>
    </Container>
  )
}

export default AddUser
